import { AppBar, Toolbar, Typography, styled, InputBase, IconButton, Box, Menu, menuItemClasses, buttonClasses, Popper } from '@mui/material'
import ShoppingBagTwoToneIcon from '@mui/icons-material/ShoppingBagTwoTone';
import React from 'react'
import Badge from '@mui/material/Badge';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import PersonIcon from '@mui/icons-material/Person';
import FavoriteIcon from '@mui/icons-material/Favorite';

const StyledToolBar = styled(Toolbar)({
    display: "flex",
    justifyContent: "space-between",
    backgroundColor: "orange",
});
const Search = styled("div")(({ theme }) => ({
    backgroundColor: "white",
    padding: "0 10px",
    borderRadius: theme.shape.borderRadius,
    width: "20%"
}));
const Icons = styled("Box")(({ theme }) => ({
    display: "none",
    alignItems: "center",
    gap: "20px",
    color: "white",
    [theme.breakpoints.up("sm")]: {
        display: "flex"
    }
}));
const StyledBadge = styled(Badge)(({ theme }) => ({
    '& .MuiBadge-badge': {
        right: -3,
        top: 13,
        border: `2px solid ${theme.palette.background.paper}`,
        padding: '0 4px',
    },
}));
const [buttonElement, setButtonElement] = React.useState(null);

const [isOpen, setOpen] = React.useState(false);
const menuActions = React.useRef(null);
const preventReopen = React.useRef(false);

const updateAnchor = React.useCallback((node) => {
    setButtonElement(node);
}, []);

const handleButtonClick = (event) => {
if (preventReopen.current) {
    event.preventDefault();
preventReopen.current = false;
return;
}

setOpen((open) => !open);
};

const handleButtonMouseDown = () => {
if (isOpen) {
    // Prevents the menu from reopening right after closing
    // when clicking the button.
    preventReopen.current = true;
}
};

const handleButtonKeyDown = (event) => {
if (event.key === 'ArrowDown' || event.key === 'ArrowUp') {
    event.preventDefault();
setOpen(true);
if (event.key === 'ArrowUp') {
    // Focus the last item when pressing ArrowUp.
    menuActions.current?.dispatch({
        type: ListActionTypes.keyDown,
        key: event.key,
        event,
    });
}
}
};

const createHandleMenuClick = (menuItem) => {
return () => {
    console.log(`Clicked on ${menuItem}`);
setOpen(false);
buttonElement?.focus();
};
};

const blue = {
    100: '#DAECFF',
    200: '#99CCF3',
    400: '#3399FF',
    500: '#007FFF',
    600: '#0072E5',
    900: '#003A75',
};

    const grey = {
    50: '#f6f8fa',
    100: '#eaeef2',
    200: '#d0d7de',
    300: '#afb8c1',
    400: '#8c959f',
    500: '#6e7781',
    600: '#57606a',
    700: '#424a53',
    800: '#32383f',
    900: '#24292f',
};

    const StyledListbox = styled('ul')(
    ({theme}) => `
    font-family: IBM Plex Sans, sans-serif;
    font-size: 0.875rem;
    box-sizing: border-box;
    padding: 6px;
    margin: 12px 0;
    min-width: 200px;
    border-radius: 12px;
    overflow: auto;
    outline: 0px;
    background: ${theme.palette.mode === 'dark' ? grey[900] : '#fff'};
    border: 1px solid ${theme.palette.mode === 'dark' ? grey[700] : grey[200]};
    color: ${theme.palette.mode === 'dark' ? grey[300] : grey[900]};
    box-shadow: 0px 4px 30px ${theme.palette.mode === 'dark' ? grey[900] : grey[200]};
    `,
    );

    const StyledMenuItem = styled(MenuItem)(
    ({theme}) => `
    list-style: none;
    padding: 8px;
    border-radius: 8px;
    cursor: default;
    user-select: none;

    &:last-of-type {
        border - bottom: none;
}

    &.${menuItemClasses.focusVisible} {
        outline: 3px solid ${theme.palette.mode === 'dark' ? blue[600] : blue[200]};
    background-color: ${theme.palette.mode === 'dark' ? grey[800] : grey[100]};
    color: ${theme.palette.mode === 'dark' ? grey[300] : grey[900]};
}

    &.${menuItemClasses.disabled} {
        color: ${theme.palette.mode === 'dark' ? grey[700] : grey[400]};
}

    &:hover:not(.${menuItemClasses.disabled}) {
        background - color: ${theme.palette.mode === 'dark' ? grey[800] : grey[100]};
    color: ${theme.palette.mode === 'dark' ? grey[300] : grey[900]};
}
    `,
    );

    const TriggerButton = styled(Button)(
    ({theme}) => `
    font-family: IBM Plex Sans, sans-serif;
    font-size: 0.875rem;
    box-sizing: border-box;
    min-height: calc(1.5em + 22px);
    border-radius: 12px;
    padding: 12px 16px;
    line-height: 1.5;
    background: ${theme.palette.mode === 'dark' ? grey[900] : '#fff'};
    border: 1px solid ${theme.palette.mode === 'dark' ? grey[700] : grey[200]};
    color: ${theme.palette.mode === 'dark' ? grey[300] : grey[900]};

    transition-property: all;
    transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
    transition-duration: 120ms;

    &:hover {
        background: ${theme.palette.mode === 'dark' ? grey[800] : grey[50]};
    border-color: ${theme.palette.mode === 'dark' ? grey[600] : grey[300]};
}

    &.${buttonClasses.focusVisible} {
        border - color: ${blue[400]};
    outline: 3px solid ${theme.palette.mode === 'dark' ? blue[500] : blue[200]};
}
    `,
    );

    const StyledPopper = styled(Popper)`
    z-index: 1;
    `;

export const Navbar = () => {
    return (
        <AppBar position='sticky'>
            <StyledToolBar>
                <Typography variant='h6' sx={{ display: { sx: "none,", sm: "block" } }}>
                    CATER PİE
                </Typography>
                <ShoppingBagTwoToneIcon sx={{ display: { xs: "block", sm: "none" } }} />
                <Search><InputBase placeholder='search..' /></Search>
                <Icons>
                    <IconButton aria-label="cart">
                        <StyledBadge color="secondary">
                            <FavoriteIcon />
                            <Typography>Favorilerim</Typography>
                        </StyledBadge>
                    </IconButton>
                    <IconButton aria-label="cart">
                        <StyledBadge color="secondary">
                            <ShoppingCartIcon />
                            <Typography>Sepetim</Typography>
                        </StyledBadge>
                    </IconButton>

                    <IconButton aria-label="cart">
                        <StyledBadge color="secondary">
                            <PersonIcon />
                                <TriggerButton
                                    type="button"
                                    onClick={handleButtonClick}
                                    onKeyDown={handleButtonKeyDown}
                                    onMouseDown={handleButtonMouseDown}
                                    ref={updateAnchor}
                                    aria-controls={isOpen ? 'simple-menu' : undefined}
                                    aria-expanded={isOpen || undefined}
                                    aria-haspopup="menu"
                                >
                                    Dashboard
                                </TriggerButton>

                                <Menu
                                    actions={menuActions}
                                    open={isOpen}
                                    onOpenChange={(open) => {
                                        setOpen(open);
                                    }}
                                    anchorEl={buttonElement}
                                    slots={{ root: StyledPopper, listbox: StyledListbox }}
                                    slotProps={{ listbox: { id: 'simple-menu' } }}
                                >
                                    <StyledMenuItem onClick={createHandleMenuClick('Profile')}>
                                        Profile
                                    </StyledMenuItem>
                                    <StyledMenuItem onClick={createHandleMenuClick('My account')}>
                                        My account
                                    </StyledMenuItem>
                                    <StyledMenuItem onClick={createHandleMenuClick('Log out')}>
                                        Log out
                                    </StyledMenuItem>
                                </Menu>                            


                        </StyledBadge>
                    </IconButton>

                </Icons>


            </StyledToolBar>
        </AppBar>
    )
}
